int fm_init()
{
    TA3CCTL0 = 0;                           // TACCR0 interrupt disabled
    TA3CTL = TACLR;
    TA3CCR0 = 1600L;                        // 5khz @ 8e6 Hz clk
    TA3CTL = TASSEL__SMCLK | TACLR;         // SMCLK
    return 0;
}

int fm_start()
{
    TA3CTL |= TACLR;                        // Clear count
    TA3CTL |= MC__UP;                       // Start timer in UP mode
    TA3CCTL0 = CCIE;                        // TACCR0 interrupt enabled
    return 0;
}

int fm_stop()
{
    TA3CTL = TACLR;                         // Clear count
    TA3CCTL0 = 0;                           // TACCR0 interrupt disabled
    return 0;
}
